import React from 'react';
import ReactPlayer from 'react-player';

const ResponsivePlayer = (url, handleProgress) => {
  console.log(url)&&(
  <div className="video-inner">
    <ReactPlayer
      className='react-player'
      url={url}
      controls='true'
      width='100%'
      height='100%'
    />
  </div>
)
}

export default ResponsivePlayer;
